import React, { Component } from 'react';

import { Link } from 'react-router-dom';

export default class ProjectCard extends Component {
    state = {

    };

    render () {
        return (
            <section id={this.props.projectName} className="project-card">
                <Link to={"/work/" + this.props.projectName} className="cover-link" />
                <div className="info">
                    <h2>StartupMatch</h2>
                    <h3>2019 &middot; Design & Frontend Dev</h3>
                    <p>
                        A case study on the user research, interaction design and frontend development processes
                        of creating a job board for startups developed by Founders at the University of Illinois at Urbana-Champaign.
                    </p>
                    <Link to={"/work/" + this.props.projectName} className="button"><span>Read More &rarr;</span></Link>
                </div>
            </section>
        )
    }
}
